import { Button, Collapse, Grid, Link, makeStyles } from "@mui/material";

import React, { useState } from "react";

const useStyles = makeStyles(() => ({
  menuIcon: {
    padding: "0 15px",
    display: "inline-flex",
    left: "0px",
    alignItems: "center",
    height: "24px",
    color: "white",
    "& svg": {
      fontSize: "30px",
    },
  },

  menu: {
    color: "#000",
    position: "absolute",
    marginTop: "65px",
    zIndex: 1000,
    background: "white",
    width: "100%",
    left: "0px",
  },
  menuItem: {
    height: "50px",
    display: "flex",
    justifyContent: "left",
    alignItems: "center",
    padding: "0 20px",
  },
  link: {
    fontFamily: 'Roboto, "Helvetica Neue", sans-serif',
    color: "#00135f",
    fontSize: "16px",
    fontWeight: "bold",
    lineHeight: "28px",
    "&:link": {
      textDecoration: "none",
    },
    "&:visited": {
      textDecoration: "none",
      color: '#00135f"',
    },
    "&:hover": {
      textDecoration: "none",
      color: '#00135f"',
    },
    "&:active": {
      textDecoration: "none",
      color: '#00135f"',
    },
  },
}));

const MobileHeader = () => {
  const classes = useStyles;
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <>
      <Grid
        container
        direction="row"
        justifyContent="space-between"
        alignItems="center"
      >
        <Grid>
          <Button className={classes.menuIcon} onClick={toggleMenu}>
            btn
          </Button>
        </Grid>
        <Grid>
          <Button className={classes.menuIcon}>{username}</Button>
        </Grid>
      </Grid>
      <Collapse in={isMenuOpen} className={classes.menu}>
        <Grid item className={classes.menuItem}>
          Home
        </Grid>
        <Grid item className={classes.menuItem}>
          Haha
        </Grid>
      </Collapse>
    </>
  );
};

export default MobileHeader;
